use core::cmp::min;
use std::collections::HashSet;

fn is_swapped_case(c1: char, c2: char) -> bool {
    (c1.is_lowercase() && c1.to_uppercase().to_string() == c2.to_string())
        || (c1.is_uppercase() && c1.to_lowercase().to_string() == c2.to_string())
}

fn react(input: &str) -> usize {
    let mut s: Vec<char> = Vec::new();
    for i in 0..input.len() {
        match s.len() {
            0 => s.push(input.chars().nth(i).unwrap()),
            n => {
                let last_char = s[n - 1];
                if is_swapped_case(last_char, input.chars().nth(i).unwrap()) {
                    s.remove(n - 1);
                } else {
                    s.push(input.chars().nth(i).unwrap());
                }
            }
        }
    }
    s.len()
}

fn main() {
    let input = String::from("");

    let unique: HashSet<String> = input
        .chars()
        .map(|c| c.to_uppercase().to_string())
        .collect();

    println!("Part 1: {}", react(&input));

    let mut min_v: usize = 0;
    for ch in unique {
        let f: String = input
            .chars()
            .filter(|c| ch != c.to_string() && ch.to_lowercase() != c.to_string())
            .collect();
        if min_v == 0 {
            min_v = react(&f);
        } else {
            min_v = min(min_v, react(&f));
        }
    }
    println!("Part 2: {}", min_v);
}
